import { TypeList } from "./TypeList"

export interface IWineTypes {
  id: number,
  label: string,
  src: string,
  alt: string
}

export const wineTypes: IWineTypes[] = [
  {
    id: 0,
    label: '레드 와인',
    src: '/img/red-wine.jpg',
    alt: 'red wine'
